import './App.css';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import LoginForm from './components/LoginForm';

const App = () => {
  return (
    <div className="App">
      <header className="App-header">

      </header>
      <BrowserRouter>
        <Routes>
          <Route path="/login-form">
            <h1>Hello</h1>
          </Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
